local function getMovData(frameData)
	local originData = frameData.mov;
	local movData = nil;
	if (originData) then
		movData = {};
		movData.ax = originData.ax;
		movData.vx = originData.vx;
		movData.ay = originData.ay;
		movData.vy = originData.vy;
		movData.t = originData.t;
	end
	return movData;
end

local function getSpecialData(frameData)
	local originData = frameData.special;
	local specialData = nil;
	if (originData) then
		specialData = {};
		specialData.effect = originData.effect;
		specialData.eff_move_t = originData.eff_move_t;
		specialData.hit_eff = originData.hit_eff;
		specialData.sfx = originData.sfx;
		specialData.hit_sfx = originData.hit_sfx;
		specialData.effPos = {x = 0, y = 0};
		if (originData.eff_x) then
			specialData.effPos.x = originData.eff_x;
		end
		if (originData.eff_y) then
			specialData.effPos.y = originData.eff_y;
		end
		specialData.hitPos = {x = 0, y = 0};
		if (originData.hit_x) then
			specialData.hitPos.x = originData.hit_x;
		end
		if (originData.hit_y) then
			specialData.hitPos.y = originData.hit_y;
		end
		if (originData.eff_follow == "interval") then
			specialData.eff_follow = BATTLE_EFFECT_MOVE_INTERVAL;
		elseif (originData.eff_follow == "instant") then
			specialData.eff_follow = BATTLE_EFFECT_MOVE_INSTANT;
		else
			specialData.eff_follow = BATTLE_EFFECT_MOVE_NONE;
		end
	end
	return specialData;
end

local function getMoveData(frameData)
	local originData = frameData.move;
	local moveData = nil;
	if (originData) then
		moveData = {};
		moveData.moveType = originData.moveType;
		moveData.offset = originData.offset;
		moveData.duration = originData.duration / FPS;
		moveData.offsetY = originData.offsetY;
	end
	return moveData;
end

function getSkillData(skillType)
	local skillData = m_database[skillType];
	local framesInfo = {};
	if(skillData == nil)then
		CCLuaLog("the local skill data " .. skillType .. "is nil, please check file SkillData");
	end
	for i, aFrame in ipairs(skillData) do
		local frameInfo = {};
		frameInfo.frame = aFrame.frame;
		frameInfo.anim = aFrame.anim;
		frameInfo.damage = aFrame.damage;
		frameInfo.final = aFrame.final;
		frameInfo.shock_t = aFrame.shock_t;
		frameInfo.mov = getMovData(aFrame);
		frameInfo.special = getSpecialData(aFrame);
		frameInfo.move = getMoveData(aFrame);
		frameInfo.color = getColorData(aFrame);
		frameInfo.buffList = getBuffData(aFrame);
		frameInfo.scale = getScale(aFrame);
		table.insert(framesInfo, frameInfo);
		if(aFrame.isSpecil ~= nil)then
			frameInfo.isSpecil = aFrame.isSpecil;
		end
	end
	return framesInfo;
end

function getBuffData(frameData)
	local originData = frameData.buffList;
	local buff = nil;
	if(originData)then
		buff = {};
		for i, buf in ipairs(originData) do
			table.insert(buff,buf);
		end
	end
	return buff;
end 

function getColorData(frameData)
	local originData = frameData.color;
	local colorData = nil;
	if (originData) then
		colorData = {};
		colorData.target = originData.target;
		colorData.duration = originData.duration;
		colorData.r = originData.r;
		colorData.g = originData.g;
		colorData.b = originData.b;
		colorData.a = originData.a;
	end
	return colorData;
end

function getScale(frameData)
	local originData = frameData.scale;
	local scaleData = nil;
	if (originData) then
		scaleData = {};
		scaleData.scale = originData.scale;
		scaleData.ticker = originData.t;
		scaleData.duration = originData.t1;
	end
	return scaleData;
end

function getProperties(skillType)
	local properties = m_database[skillType].properties;
	return properties;
end
